                            onChange={inputData}
                        
                        />
                        <br/>
                        <input type="text" placeholder="Enter Email Id"   name = "Email"/>
                      

                        <br/>
                        <button type="submit">Submit</button>
                    
                </form>
                </div>
                
    return Data ;  
}
export default Form ;
